entire:
The king’s heart is in the hand of the LORD, 
Like the rivers of water;
He turns it wherever He wishes.

I rise before the dawning of the morning,
And cry for help;
I hope in Your word.I’m

Why do you fume with envy, you mountains of many peaks?
This is the mountain which God desires to dwell in;
Yes, the LORD will dwell in it forever.

Those from among you
Shall build the old waste places;
You shall raise up the foundations of many generations;
And you shall be called the Repairer of the Breach,
The Restorer of Streets to Dwell In.

Now the just shall live by faith;
But if anyone draws back,
My soul has no pleasure in him.

So you, by the help of your God, return;
Observe mercy and justice,
And wait on your God continually.

I will make you a great nation;
I will bless you
And make your name great;
And you shall be a blessing.

Beat your plowshares into swords
And your pruning hooks into spears;
Let the weak say, ‘I am strong.’ ”

Behold the proud,
His soul is not upright in him;
But the just shall live by his faith.

Enlarge the place of your tent,
And let them stretch out the curtains of your dwellings;
Do not spare;
Lengthen your cords,
And strengthen your stakes.

I have been young, and now am old;
Yet I have not seen the righteous forsaken,
Nor his descendants begging bread.

Benjamin is a ravenous wolf;
In the morning he shall devour the prey,
And at night he shall divide the spoil.

But now, O LORD,
You are our Father;
We are the clay, and You our potter;
And all we are the work of Your hand.

The LORD is good,
A stronghold in the day of trouble;
And He knows those who trust in Him.

I have wounded them,
So that they could not rise;
They have fallen under my feet.

Listen, O daughter,
Consider and incline your ear;
Forget your own people also, and your father’s house

Lead me in Your truth and teach me,
For You are the God of my salvation;
On You I wait all the day.

That our sons may be as plants grown up in their youth;
That our daughters may be as pillars,
Sculptured in palace style;

He does not delight in the strength of the horse;
He takes no pleasure in the legs of a man. The LORD takes pleasure in those who fear Him,
In those who hope in His mercy.

The Spirit of the Lord GOD is upon Me,
Because the LORD has anointed Me
To preach good tidings to the poor;
He has sent Me to heal the brokenhearted,
To proclaim liberty to the captives,
And the opening of the prison to those who are bound;

The LORD also will roar from Zion,
And utter His voice from Jerusalem;
The heavens and earth will shake;
But the LORD will be a shelter for His people,
And the strength of the children of Israel.

Woe to those who call evil good, and good evil;
Who put darkness for light, and light for darkness;
Who put bitter for sweet, and sweet for bitter!

For Sheol cannot thank You,
Death cannot praise You;
Those who go down to the pit cannot hope for Your truth.
The living, the living man, he shall praise You,
As I do this day;
The father shall make known Your truth to the children.
“The LORD was ready to save me;
Therefore we will sing my songs with stringed instruments
All the days of our life, in the house of the LORD.”

Young and old lie
On the ground in the streets;
My virgins and my young men
Have fallen by the sword;
You have slain them in the day of Your anger,
You have slaughtered and not pitied.

You prepare a table before me in the presence of my enemies;
You anoint my head with oil;
My cup runs over.

You prepare a table before me in the presence of my enemies;
You anoint my head with oil;
My cup runs over.
